      "title": "Fixed Xml",
      "type": "string",
      "value": "<ITEM>In dem Bericht-Hau\u0000fc ist ein Frantz\u0000sisches Project zu haben, von einem Tractat welcher zu Neufch\u0000tel durch Praenumerationen getruckt werden solle; <BIBL><TITLE>Tractat</TITLE> von denen Schweitzerischen und benachbarten Naturalien und figurirten Steinen</BIBL>, welche in <FORMAT>6o. sch\u0000nen Kupferen</FORMAT> vorgestellet werden. Das gantze Werck welches ehedessen zu <PLACE>Lucern</PLACE> in Lateinischer Sprach, und bey weitem nicht so vollst\u0000ndig getruckt worden, und <PRICE>2. Thaler Species</PRICE> gekostet hat, kommet dermahlen nur auf die Helffte, nemlich auf <PRICE>drey Francken</PRICE>, davon man einen <PRICE>Francken</PRICE> zum voraus, und bey Empfang des Werckes die zwey \u0000abrigen bezahlet; Das weitere wird aus obbesagtem Project mit mehrerm zu vernehmen seyn.</ITEM>"
    },
    "number_of_corrections": {
      "description": "The number of corrections made to the original XML.",
      "title": "Number Of Corrections",
      "type": "integer",
      "value": 4
    },
    "explanation": {
      "default": null,
